INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 5, "戦闘のサポートが得意な、心優しい少女", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 100201, 2, 17, 47, "ヒューマン", 0, "ユイ", "トゥインクルウィッシュ", 158, 4, "料理、人間観察");
