INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 10, "探検好きのイタズラっ子", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "諸星すみれ", 100401, 5, 9, 27, "ヒューマン", 0, "ミソギ", "リトルリリカル", 128, 8, "いたずら、探検");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 25, "ヒーローに憧れる騎士見習いの少女", "？？？", "下田麻美", 100501, 8, 12, 40, "獣人族", 0, "マツリ", "王宮騎士団（NIGHTMARE）", 146, 11, "ヒーローごっこ");
