INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 23, "プリン大好きゴースト娘", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 100701, 7, 14, 32, "魔族", 0, "ミヤコ", "悪魔偽王国軍（ディアボロス）", 130, 1, "プリンを食べること");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 10, "ボクは誰よりも美しい", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 100801, 15, 14, 40, "エルフ", 0, "ユキ", "ヴァイスフリューゲル　ランドソル支部", 150, 10, "鏡で自分を見ること");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 5, "前世を信じる中二病患者、「疾風の冥姫」", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 100901, 13, 17, 45, "魔族", 0, "アンナ", "トワイライトキャラバン", 159, 7, "小説執筆");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 22, "マホマホ王国のプリンセス", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "内田真礼", 101001, 10, 16, 42, "獣人族", 0, "マホ", "自警団（カォン）", 155, 9, "空想、ぬいぐるみ集め");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 25, "人懐っこくてマシンガントークな妹系少女", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "阿澄佳奈", 101101, 3, 15, 44, "ヒューマン", 0, "リノ", "ラビリンス", 156, 8, "お裁縫");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 24, "みんなのために超能力を使う眠り姫", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "大橋彩香", 101201, 6, 17, 46, "エルフ", 0, "ハツネ", "フォレスティエ", 156, 12, "妹と遊ぶこと、二度寝、昼寝、早寝");
