INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 3, "頭脳明晰な美少女名探偵", "test", "水瀬いのり", 101401, 10, 15, 41, "獣人族", 0, "カスミ", "自警団（カォン）", 152, 11, "読書、推理");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 5, "母性溢れる優しいみんなの「ミサト先生」", "test", "國府田マリ子", 101501, 6, 21, 54, "エルフ", 0, "ミサト", "フォレスティエ", 165, 9, "絵本作り");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 10, "天真爛漫で人気者のカリスマモデル", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 101601, 14, 18, 48, "魔族", 0, "スズナ", "ルーセント学院", 167, 4, "ファッション");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 7, "いつでも「なんくるないさ～」な天然娘", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 101701, 10, 19, 53, "獣人族", 0, "カオリ", "自警団（カォン）", 158, 7, "踊り、空手");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 14, "多くの男性を魅了する無垢な女教師", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "伊藤静", 101801, 14, 23, 52, "魔族", 0, "イオ", "ルーセント学院", 162, 8, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 3, "お歌もにんじんも、ウサギさんも大好き♪", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "日高里菜", 102001, 5, 10, 21, "獣人族", 0, "ミミ", "リトルリリカル", 117, 4, "かわいいもの集め");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 9, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 102101, 9, 12, 40, "ヒューマン", 0, "クルミ", "サレンディア救護院", 150, 6, "観劇、おままごと");
