INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 10, "ぷうきちといつも一緒！", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 102301, 9, 14, 38, "ヒューマン", 0, "アヤネ", "サレンディア救護院", 148, 5, "屋内でできる遊び");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 12, "お嬢さまのためにがんばるドジっ娘メイド", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 102501, 9, 15, 43, "ヒューマン", 0, "スズメ", "サレンディア救護院", 154, 12, "ご奉仕");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 1, "遊びと睡眠が何より大事なぐうたら娘", "test", "小岩井ことり", 102601, 11, 17, 42, "獣人族", 0, "リン", "牧場（エリザベスパーク）", 144, 1, "あんパン");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 30, "運命の相手に一途すぎる乙女", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 102701, 13, 16, 43, "魔族", 0, "エリコ", "トワイライトキャラバン", 154, 7, "実験、裁縫、料理");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 4, "救護院を経営する優しい庶民派お嬢様", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "堀江由衣", 102801, 9, 17, 43, "エルフ", 0, "サレン", "サレンディア救護院", 156, 10, "経営、お茶会");
