INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 22, "占いが得意な霊能少女", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 103101, 7, 18, 42, "魔族", 0, "シノブ", "悪魔偽王国軍（ディアボロス）", 157, 12, "占い");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 12, "一人前の商人を目指すパワフルお嬢様", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "松嵜麗", 103201, 12, 18, 45, "ヒューマン", 0, "アキノ", "メルクリウス財団", 157, 3, "慈善事業");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 3, "みんなを笑顔にするお笑い牧場主", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "新田恵海", 103301, 11, 20, 35, "ヒューマン", 0, "マヒル", "牧場（エリザベスパーク）", 142, 3, "漫才");
