INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 11, "義理堅くてからかい好きな剣術少女", "test", "茅原実里", 103701, 8, 13, 43, "ヒューマン", 0, "トモ", "王宮騎士団（NIGHTMARE）", 149, 8, "剣術、年長者をからかう");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 3, "読書が趣味の病弱少女", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "小清水亜美", 103801, 11, 14, 40, "獣人族", 0, "シオリ", "牧場（エリザベスパーク）", 153, 11, "読書、お散歩");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 6, "「友達」に憧れる、エルフの森の女の子", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "花澤香菜", 104001, 6, 13, 44, "エルフ", 0, "アオイ", "フォレスティエ", 158, 6, "友達作りのイメトレ");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 3, "人々を守るために歌う、唱喚士の少女", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 104201, 4, 17, 46, "ヒューマン", 0, "チカ", "カルミナ", 163, 6, "各種楽器");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 9, "男勝りで情に厚いワイルド娘", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "小松未可子", 104301, 10, 17, 54, "獣人族", 0, "マコト", "自警団（カォン）", 168, 8, "お菓子作り");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 5, "かつては夜を支配した最強の吸血鬼", "test", "丹下桜", 104401, 7, "??", 50, "魔族", 0, "イリヤ", "悪魔偽王国軍（ディアボロス）", 172, 5, "世界征服");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 19, "妄想大好き！　ほんとは照れ屋な女の子", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 104501, 15, 18, 49, "ヒューマン", 0, "クウカ", "ヴァイスフリューゲル　ランドソル支部", 157, 11, "小説を読むこと");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("AB", 1, "弱きを助け強きをくじく猫娘", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 104601, 12, 18, 48, "獣人族", 0, "タマキ", "メルクリウス財団", 158, 3, "猫とたわむれること");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("A", 25, "素顔を見せない冷静沈着な女性騎士", "？？？", "川澄綾子", 104701, 8, 25, 50, "ヒューマン", 0, "ジュン", "王宮騎士団（NIGHTMARE）", 171, 10, "格闘技、湯浴み");
INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("O", 11, "仕事も私事も効率優先な傭兵少女", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 104801, 12, 20, 49, "ヒューマン", 0, "ミフユ", "メルクリウス財団", 163, 11, "傭兵などのアルバイト");
