INSERT INTO `v1_3a7d0e63aad22cdf34b0f75f8e0996c7982b1466ab666617939c24a5f42783a8` VALUES ("B", 9, "泣き虫で臆病な守ってあげたい女の子", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 108501, 9, 12, 40, "ヒューマン", 0, "クルミ（クリスマス）", "サレンディア救護院", 150, 6, "観劇、おままごと");
